// ============================================================================
// UTILITY FUNCTIONS
// ============================================================================

function normalizeText(text) {
  if (!text) return '';
  return String(text)
    .toLowerCase()
    .trim()
    .replace(/[^a-z0-9]+/g, ' ')
    .replace(/\s+/g, ' ');
}

function normalizeGender(gender) {
  if (!gender) return 'Equal';
  const g = String(gender).toLowerCase().trim();
  if (g === 'male' || g === 'm') return 'Male';
  if (g === 'female' || g === 'f') return 'Female';
  return 'Equal';
}

function formatCurrency(amount) {
  if (!amount) return '₹0';
  const num = Number(amount);
  if (num >= 10000000) return `₹${(num / 10000000).toFixed(2)}Cr`;
  if (num >= 100000) return `₹${(num / 100000).toFixed(2)}L`;
  if (num >= 1000) return `₹${(num / 1000).toFixed(0)}K`;
  return `₹${num}`;
}

// ============================================================================
// QUERY ENGINE (Pure JS implementation of rules engine logic)
// ============================================================================

function matchesOffer(userCriteria, offer) {
  // Gender matching: offer gender must be Equal or match user gender
  const offerGender = normalizeGender(offer.gender);
  const userGender = normalizeGender(userCriteria.gender);
  if (offerGender !== 'Equal' && offerGender !== userGender) {
    return false;
  }

  // Amount matching: user amount must be within offer range
  const userAmount = Number(userCriteria.loanAmount) || 0;
  const minAmount = offer.loan?.amount?.min || 0;
  const maxAmount = offer.loan?.amount?.max || 99999999;
  if (userAmount < minAmount || userAmount > maxAmount) {
    return false;
  }

  // Security matching: if user wants secured, offer must support it
  const userSecured = userCriteria.loanType === 'Secured';
  const offerRequiresSecurity = offer.security?.required === true;
  
  if (userSecured && !offerRequiresSecurity) {
    return false; // User wants secured but offer doesn't support it
  }
  if (!userSecured && offerRequiresSecurity) {
    return false; // User wants unsecured but offer requires security
  }

  return true;
}

function matchesUniversity(offer, universityName, institutes) {
  if (!universityName || universityName === 'Any') return true;
  
  const normUniv = normalizeText(universityName);
  const lenderName = offer._lenderName || '';
  
  // Find matching institutes for this lender and university
  const matches = institutes.filter(inst => {
    const instLender = normalizeText(inst.lenderName);
    const instUniv = normalizeText(inst.university);
    return instLender === normalizeText(lenderName) && instUniv.includes(normUniv);
  });
  
  return matches.length > 0;
}

function matchesCountry(offer, countryName, institutes) {
  if (!countryName || countryName === 'Any') return true;
  
  const normCountry = normalizeText(countryName);
  const lenderName = offer._lenderName || '';
  
  // Check country scope in offer
  if (offer.countryScope) {
    const scope = normalizeText(offer.countryScope);
    if (scope.includes('only') && scope.includes(normCountry)) return true;
    if (scope.includes('exclude') && scope.includes(normCountry)) return false;
  }
  
  // Check institutes data
  const matches = institutes.filter(inst => {
    const instLender = normalizeText(inst.lenderName);
    const instCountry = normalizeText(inst.country);
    return instLender === normalizeText(lenderName) && instCountry === normCountry;
  });
  
  return matches.length > 0;
}

function matchesLevelOfStudy(offer, levelOfStudy) {
  if (!levelOfStudy || levelOfStudy === 'Any') return true;
  
  const offerLevel = normalizeText(offer.institute?.level_of_study || '');
  const userLevel = normalizeText(levelOfStudy);
  
  // Simple token matching
  const offerTokens = offerLevel.split(' ');
  const userTokens = userLevel.split(' ');
  
  return userTokens.some(token => offerTokens.some(oToken => oToken.includes(token)));
}

function queryAllBanks(criteria) {
  const results = [];
  const { banks, institutes } = BUNDLED_DATA;
  
  for (const [slug, bankData] of Object.entries(banks)) {
    const lenderName = bankData.lender?.name || slug;
    
    for (const offer of bankData.offers || []) {
      // Add lender name to offer for lookups
      offer._lenderName = lenderName;
      
      // Apply all filters
      if (!matchesOffer(criteria, offer)) continue;
      if (!matchesUniversity(offer, criteria.university, institutes)) continue;
      if (!matchesCountry(offer, criteria.country, institutes)) continue;
      if (!matchesLevelOfStudy(offer, criteria.levelOfStudy)) continue;
      
      // This offer matches!
      results.push({
        slug,
        lenderName,
        offer,
        bankData
      });
    }
  }
  
  return results;
}

