let previousSnapshot = new Map();

function renderTable(results, criteria) {
  const tableHead = document.getElementById('tableHead');
  const tableBody = document.getElementById('tableBody');
  
  if (!results || results.length === 0) {
    document.getElementById('tableWrapper').style.display = 'none';
    document.getElementById('emptyState').style.display = 'block';
    return;
  }
  
  document.getElementById('emptyState').style.display = 'none';
  document.getElementById('tableWrapper').style.display = 'block';
  
  // Generate columns based on loan type
  const isSecured = criteria.loanType === 'Secured';
  const columns = [
    { key: 'lender', label: 'Lender' },
    { key: 'interest', label: 'Interest Rate' },
    { key: 'margin', label: 'Margin %' },
    { key: 'tenure', label: 'Tenure (years)' },
  ];
  
  if (isSecured) {
    columns.push({ key: 'security', label: 'Security Coverage' });
  }
  
  columns.push(
    { key: 'universities', label: 'Listed Universities' },
    { key: 'details', label: 'Details' }
  );
  
  // Render header
  tableHead.innerHTML = `
    <tr>
      ${columns.map(col => `<th>${col.label}</th>`).join('')}
    </tr>
  `;
  
  // Render rows
  const currentSnapshot = new Map();
  const rows = results.map((result, idx) => {
    const { offer, lenderName, slug } = result;
    const rowKey = `${slug}-${idx}`;
    
    const rowData = {
      lender: lenderName,
      interest: `${offer.interest?.rate || 'N/A'}% ${getGenderBadge(offer.gender)}`,
      margin: `${offer.margin || 0}%`,
      tenure: offer.repayment_tenure?.tenure || 'N/A',
      security: offer.security?.coverageDisplay || 'N/A',
      universities: `<span class="clickable-badge" data-action="universities" data-slug="${slug}" data-idx="${idx}">View List</span>`,
      details: `<span class="clickable-badge" data-action="details" data-slug="${slug}">View Details</span>`
    };
    
    currentSnapshot.set(rowKey, rowData);
    
    return `
      <tr>
        ${columns.map(col => {
          const value = rowData[col.key] || 'N/A';
          const oldValue = previousSnapshot.get(rowKey)?.[col.key];
          const changed = oldValue && oldValue !== value ? 'changed' : '';
          return `<td class="${changed}">${value}</td>`;
        }).join('')}
      </tr>
    `;
  }).join('');
  
  tableBody.innerHTML = rows;
  previousSnapshot = currentSnapshot;
}

function getGenderBadge(gender) {
  const g = normalizeGender(gender);
  if (g === 'Male') return '<span class="badge gender-m">M</span>';
  if (g === 'Female') return '<span class="badge gender-f">F</span>';
  return '<span class="badge gender-b">B</span>';
}

// ============================================================================
// COMBOBOX IMPLEMENTATION
// ============================================================================

function initCombobox(inputId, dropdownId, options) {
  const input = document.getElementById(inputId);
  const dropdown = document.getElementById(dropdownId);
  let highlightedIndex = -1;
  
  input.addEventListener('focus', () => {
    renderDropdown(options);
    dropdown.classList.add('open');
  });
  
  input.addEventListener('input', () => {
    const query = normalizeText(input.value);
    const filtered = options.filter(opt => normalizeText(opt).includes(query));
    renderDropdown(filtered);
    dropdown.classList.add('open');
  });
  
  input.addEventListener('keydown', (e) => {
    const visibleOptions = [...dropdown.querySelectorAll('.combobox-option')];
    
    if (e.key === 'ArrowDown') {
      e.preventDefault();
      highlightedIndex = Math.min(highlightedIndex + 1, visibleOptions.length - 1);
      updateHighlight(visibleOptions);
    } else if (e.key === 'ArrowUp') {
      e.preventDefault();
      highlightedIndex = Math.max(highlightedIndex - 1, -1);
      updateHighlight(visibleOptions);
    } else if (e.key === 'Enter') {
      e.preventDefault();
      if (highlightedIndex >= 0 && visibleOptions[highlightedIndex]) {
        visibleOptions[highlightedIndex].click();
      }
      dropdown.classList.remove('open');
    } else if (e.key === 'Escape') {
      dropdown.classList.remove('open');
    }
  });
  
  document.addEventListener('click', (e) => {
    if (!input.contains(e.target) && !dropdown.contains(e.target)) {
      dropdown.classList.remove('open');
    }
  });
  
  function renderDropdown(opts) {
    dropdown.innerHTML = opts.map(opt => 
      `<div class="combobox-option" data-value="${opt}">${opt}</div>`
    ).join('');
    
    dropdown.querySelectorAll('.combobox-option').forEach(el => {
      el.addEventListener('click', () => {
        input.value = el.dataset.value;
        dropdown.classList.remove('open');
        input.dispatchEvent(new Event('change'));
      });
    });
  }
  
  function updateHighlight(options) {
    options.forEach((el, idx) => {
      el.classList.toggle('highlighted', idx === highlightedIndex);
    });
    if (highlightedIndex >= 0 && options[highlightedIndex]) {
      options[highlightedIndex].scrollIntoView({ block: 'nearest' });
    }
  }
}

