export function initializeLoanTable(container, options = {}) {
  // Inject styles
  const styleEl = document.createElement('style');
  styleEl.textContent = COMPONENT_STYLES;
  document.head.appendChild(styleEl);
  
  // Inject HTML
  container.innerHTML = generateHTML();
  
  // Get unique countries and universities from institutes
  const countries = ['Any', ...new Set(BUNDLED_DATA.institutes.map(i => i.country))].sort();
  const universities = ['Any', ...new Set(BUNDLED_DATA.institutes.map(i => i.university))].sort();
  const levels = ['Any', 'Postgraduate', 'Undergraduate', 'Doctorate', 'Professional/Technical', 'Executive courses'];
  
  // Initialize comboboxes
  initCombobox('country', 'countryDropdown', countries);
  initCombobox('university', 'universityDropdown', universities);
  initCombobox('levelOfStudy', 'levelDropdown', levels);
  
  // Auto-run timer
  let autoRunTimer = null;
  
  function scheduleAutoRun() {
    if (autoRunTimer) clearTimeout(autoRunTimer);
    autoRunTimer = setTimeout(() => runQuery(), 800);
  }
  
  function getCriteria() {
    return {
      gender: document.querySelector('input[name="gender"]:checked')?.value || 'Female',
      loanAmount: document.getElementById('loanAmount').value,
      loanType: document.querySelector('input[name="loanType"]:checked')?.value || 'Secured',
      country: document.getElementById('country').value || 'Any',
      university: document.getElementById('university').value || 'Any',
      levelOfStudy: document.getElementById('levelOfStudy').value || 'Any'
    };
  }
  
  function runQuery() {
    const loading = document.getElementById('loadingIndicator');
    const tableWrapper = document.getElementById('tableWrapper');
    const emptyState = document.getElementById('emptyState');
    
    loading.style.display = 'block';
    tableWrapper.style.display = 'none';
    emptyState.style.display = 'none';
    
    // Simulate async for UI responsiveness
    setTimeout(() => {
      const criteria = getCriteria();
      const results = queryAllBanks(criteria);
      renderTable(results, criteria);
      loading.style.display = 'none';
    }, 100);
  }
  
  // Attach event listeners
  container.querySelectorAll('input').forEach(input => {
    input.addEventListener('change', scheduleAutoRun);
    input.addEventListener('input', scheduleAutoRun);
  });
  
  document.getElementById('submitBtn').addEventListener('click', () => {
    if (autoRunTimer) clearTimeout(autoRunTimer);
    runQuery();
  });
  
  // Popup handling
  const popupOverlay = document.getElementById('popupOverlay');
  const popupBody = document.getElementById('popupBody');
  const popupClose = document.getElementById('popupClose');
  
  popupClose.addEventListener('click', () => {
    popupOverlay.classList.remove('open');
  });
  
  popupOverlay.addEventListener('click', (e) => {
    if (e.target === popupOverlay) {
      popupOverlay.classList.remove('open');
    }
  });
  
  container.addEventListener('click', (e) => {
    const badge = e.target.closest('[data-action]');
    if (!badge) return;
    
    const action = badge.dataset.action;
    const slug = badge.dataset.slug;
    
    if (action === 'details') {
      const lenderDetails = BUNDLED_DATA.viewDetails.records.find(
        r => normalizeText(r.lender) === normalizeText(slug.replace(/-/g, ' '))
      );
      
      if (lenderDetails) {
        popupBody.innerHTML = `
          <h2>${lenderDetails.lender}</h2>
          <div>${JSON.stringify(lenderDetails.details, null, 2)}</div>
        `;
      } else {
        popupBody.innerHTML = `<h2>Details not available</h2>`;
      }
      
      popupOverlay.classList.add('open');
    } else if (action === 'universities') {
      const lenderName = BUNDLED_DATA.banks[slug]?.lender?.name || slug;
      const matches = BUNDLED_DATA.institutes.filter(
        i => normalizeText(i.lenderName) === normalizeText(lenderName)
      );
      
      popupBody.innerHTML = `
        <h2>Listed Universities - ${lenderName}</h2>
        <ul>
          ${matches.slice(0, 50).map(m => `<li>${m.university} (${m.country})</li>`).join('')}
          ${matches.length > 50 ? `<li><em>...and ${matches.length - 50} more</em></li>` : ''}
        </ul>
      `;
      
      popupOverlay.classList.add('open');
    }
  });
  
  // Run initial query
  runQuery();
  
  // Return API
  return {
    runQuery,
    getCriteria,
    updateFilters: (newCriteria) => {
      if (newCriteria.gender) {
        document.querySelector(`input[name="gender"][value="${newCriteria.gender}"]`).checked = true;
      }
      if (newCriteria.loanAmount) {
        document.getElementById('loanAmount').value = newCriteria.loanAmount;
      }
      if (newCriteria.loanType) {
        document.querySelector(`input[name="loanType"][value="${newCriteria.loanType}"]`).checked = true;
      }
      if (newCriteria.country) {
        document.getElementById('country').value = newCriteria.country;
      }
      if (newCriteria.university) {
        document.getElementById('university').value = newCriteria.university;
      }
      if (newCriteria.levelOfStudy) {
        document.getElementById('levelOfStudy').value = newCriteria.levelOfStudy;
      }
      runQuery();
    },
    destroy: () => {
      if (autoRunTimer) clearTimeout(autoRunTimer);
      container.innerHTML = '';
      styleEl.remove();
    }
  };
}
